import moneyIcon from "@fortawesome/fontawesome-free/svgs/regular/money-bill-alt.svg";

const Navbar = () => {
  return (
    <nav>
      <h1>
        <i className={moneyIcon}> </i> {"Helo"}
      </h1>
    </nav>
  );
};

export default Navbar;
